import React from 'react'
import {UserContext} from '../App'
function ComponentF() {
	return (
		<div>
		<UserContext.Consumer>
			{
				user=> {
					return <div>User context value </div>
				}
			}
		</UserContext.Consumer>
		<h1>-Hello</h1>
		</div>
	)
}

export default ComponentF
